const buttons = document.querySelectorAll(".size-btn");

const handleButtonActivation = function() {
    buttons.forEach(btn => btn.classList.remove("active"));
    this.classList.add("active");
};

buttons.forEach(button => {
    button.addEventListener("pointerdown", handleButtonActivation);
});



const mainImage = document.querySelector('.first-img');
const thumbnails = document.querySelectorAll('.img-thumbnail');

thumbnails.forEach(thumbnail => {
  thumbnail.addEventListener('mouseenter', () => {
    mainImage.setAttribute('src', thumbnail.getAttribute('src'));
    mainImage.setAttribute('srcset', '');
    mainImage.setAttribute('sizes', '');
  });
});

document.addEventListener("DOMContentLoaded", function() {
    const whiteHearts = document.querySelectorAll(".heart-img");
    const favNotification = document.querySelector(".adding-product-to-fav");

    // Инициализация - убедимся, что уведомление скрыто
    favNotification.classList.remove("show");

    whiteHearts.forEach(heart => {
        heart.addEventListener("click", function() {
            // Показываем уведомление
            favNotification.classList.add("show");
            
            // Скрываем через 2 секунды
            setTimeout(() => {
                favNotification.classList.remove("show");
            }, 2000);
        });
    });

});
